import React from 'react';
// import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap'
function Header() {
  return (
    <Container>
      <Row>
        <Col>
          <h1 variant="primary" >
            Search for a Github username
          </h1>
        </Col>
      </Row>
    </Container>

  );
}


export default Header;
